import IconTextButton from './IconTextButton'
import Typography from '@material-ui/core/Typography';
import Grid from  '@material-ui/core/Grid';

export default function InfoPanelOne() {
  return (
    <>
    <Typography variant="h6" gutterBottom>
      Have you ever visited Dubai?
    </Typography>
    <IconTextButton tag="No"/>
    <IconTextButton leftMargin={"25"} tag="Yes"/>

    <Typography variant="h6" gutterBottom>
      Have you ever visited Dubai?
    </Typography>
    <IconTextButton tag="No"/>
    <IconTextButton leftMargin={"25"} tag="Yes"/>

    <Typography variant="h6" gutterBottom>
      Have you ever visited Dubai?
    </Typography>
    <Grid container spacing="3">
      {["Upto 3 months", "3 to 6 months", "6 to 12 months", "+12 months", "+3 years"].map((tag, idx) => (
        <Grid item xs={12}>
          <IconTextButton tag={tag}/>
        </Grid>
      ))}
    </Grid>
    
    </>
  );
}
